import React from 'react';
import {Avatar, Card} from 'antd';

const Profile = () => {

    return (
        <Card
        actions={
            [
                <div key = "twit">짹짹</div>,
                <div key = "followings">팔로잉</div>,
                <div key = "follwors">팔로워]</div>
            ]


        }>

            <Card.Meta
                avatar={<Avatar>AF</Avatar>}
                title="AppleFarm"
            />

        </Card>
    );
}
export default Profile;
